import React, {Component} from "react";
import Button from "./components/CustomButtonComponent";
import CB from './CollabFiltering.js';

class App extends Component {

  CallFunction_1(){
    //CB.is_work();
    window.location = "./CollabFiltering.js";
  }

  render(){ 
      return(                                // render is a method of react that displays on screen, return is for js
      <div className="App">
        <h1>Music Recommendation System Evaluation</h1>
        <p>
          Music recommendation system where users can choose which recommendation algorithm they enjoy better. 
          This app is part of my final project for my degree in data science imparted by University Pompeu Fabra.
        </p>
        <Button
          border="none"
          color="pink"
          height = "200px"
          onClick={() => alert("CB Button")}
          radius = "50%"
          width = "200px"
          children = "Content Based Recommender System"
        />
        <div style={{width:"25%", display:'inline-block'}}></div>
        <Button
          border="none"
          color="#9DC183"
          height = "200px"
          onClick={() => this.CallFunction_1()}
          radius = "50%"
          width = "200px"
          children = "Collaborative Filtering"
        />
      </div>
    );
  }
}

export default App;
